jQuery(document).ready(function($) {
	/*$('.gallery A').fancybox({
		'transitionIn'	:	'elastic',
		'transitionOut'	:	'elastic',
		'speedIn'		:	600, 
		'speedOut'		:	200, 
		'overlayShow'	:	false
	});*/
	
	$('.search-button').click(function() {
		$('.search-form').fadeIn();
		
		$('.search-form INPUT[type="text"]').focus();
	});
	
	$('.search-form-button').click(function() {
		$('.search-form').submit();
	});
	
	$('.search-close-button').click(function() {
		$('.search-form').fadeOut();
	});
	
	$('#voting_form').submit(function() {
		$.post('?send_voting=1', $('#voting_form').serialize(), function(html) { console.debug(html);
			if(html != 0) {
				$('.voting-box').html(html);
			}
		});
		
		return false;
	});
	
	$(document).on('click', '.gallery_tag A.point', function() {
		if($(this).hasClass('active')) {
			$(this).parent().find('.gallery-tag-content').fadeOut();
			
			$(this).removeClass('active');
		} else {
			$(this).parent().find('.gallery-tag-content').fadeIn();
			
			$(this).addClass('active');
		}
	});
	
	$(document).on('click', '.gallery_tag A.point-close', function() {
		$(this).parent().parent().find('A.point').trigger('click');
	});
	 
	 // Article Read Progress
	 var getMax = function(){
        //return $(document).height() - $(window).height();
		
		return $('.top-menu').height() + $('.main-image').height() + $('.readzone').height();
    }
    
    var getValue = function(){
        return $(window).scrollTop();
    }
    
    if('max' in document.createElement('progress')){
        // Browser supports progress element
        var progressBar = $('progress');
        
        // Set the Max attr for the first time
        progressBar.attr({ max: getMax() });

        $(document).on('scroll', function(){
            // On scroll only Value attr needs to be calculated
            progressBar.attr({ value: getValue() });
        });
      
        $(window).resize(function(){
            // On resize, both Max/Value attr needs to be calculated
            progressBar.attr({ max: getMax(), value: getValue() });
        });   
    }
    else {
        var progressBar = $('.progress-bar'), 
            max = getMax(), 
            value, width;
        
        var getWidth = function(){
            // Calculate width in percentage
            value = getValue();            
            width = (value/max) * 100;
            width = width + '%';
            return width;
        }
        
        var setWidth = function(){
            progressBar.css({ width: getWidth() });
        }
        
        $(document).on('scroll', setWidth);
        $(window).on('resize', function(){
            // Need to reset the Max attr
            max = getMax();
            setWidth();
        });
    }
	 
	 $(window).load(function() {
		render_masonry();
	 });
	 
	 $(window).resize(function() {
		 $('.section').css('min-height', $(window).height() + 'px');
		 
		 render_masonry();
	 });
	
	if($(window).width() <= 920) {
		$('.mobile-sub.wsmenu-list LI.parent-li > A').click(function() {
			var data_id = $(this).data('id');

			if(data_id != 42 && data_id != 43 && data_id != 1000 && data_id != 45) {
				$(this).parent().find('.wsmenu-click').trigger('click');
				
				return false;
			}
		});
	}
	
	$('.content P IMG').each(function() {
		var alt_text = $(this).attr('alt');
		
		if(alt_text !== undefined && alt_text.length > 0) {
			$(this).parent().append('<span class="caption">' + alt_text + '</span>');
		}
	});
	
	$('.content.full-width-image P IMG').each(function() {
		var article_wrapper_width = $('.content.full-width-image').width();
		var readzone_width = $('.readzone').width();
		
		var margin_value = (article_wrapper_width - readzone_width) / 2;

		var margin_value_left = margin_value - ((margin_value / 100 * 8.33333333));
		var margin_value_right = margin_value + ((margin_value / 100 * 8.33333333) + 30);
		
		$(this).parent().css('margin-left', '-' + margin_value_left + 'px');
		$(this).parent().css('margin-right', '-' + margin_value_right + 'px');
		
		$(this).css('width', '100%');
	});
	
	$(window).scroll(function() {
		if($(window).width() >= 920) {
			if($(window).scrollTop() > ($('.top_banner').height() + $('HEADER').height() + 130)) {
				$('BODY').addClass("fixed");
				$('NAV.top-menu').addClass("fixed");
			} else {
				$('BODY').removeClass("fixed");
				$('NAV.top-menu').removeClass("fixed");
			}

			if($(window).scrollTop() <= ($(document).height() - $(window).height() - $('FOOTER .copyright').height() - 50)) {
				$('FOOTER .menu').addClass("fixed");
			} else {
				$('FOOTER .menu').removeClass("fixed");
			}
		}
	});
});

function render_masonry() {
	
	if($(window).width() > 1500) {
		var column_width = $('.grid').width() / 4;
	} else if($(window).width() > 1050) {
		var column_width = $('.grid').width() / 3;
	} else if($(window).width() > 480) {
		var column_width = $('.grid').width() / 2;
	} else {
		var column_width = $('.grid').width() / 1;	
	}
	
	if(column_width < 320) {
		column_width = 320;
	}
	
	//column_width = 320;
	
	$('.grid-item').css('width', column_width + 'px');
	
	if($(window).width() > 480) {
		$('.grid-item.grid-item--width2').css('width', (column_width * 2) + 'px');
	} else {
		$('.grid-item.grid-item--width2').css('width', column_width + 'px');
	}
					
	$('.grid').masonry({
		 itemSelector: '.grid-item',
		 columnWidth: column_width
	});
}

$(document).ready(function() {
	if($(window).width() > 700) {
		$('.bnr-image').each(function() {
			$(this).attr('src', $(this).data('src'));
		});
		
		$('.bnr-small-image').each(function() {
			$(this).attr('src', $(this).data('src'));
		});
	} else {
		$('.bnr-image').each(function() {
			$(this).attr('src', $(this).data('mobile-src'));
		});
		
		$('.bnr-small-image').each(function() {
			$(this).attr('src', $(this).data('mobile-src'));
		});
	}
});

$(window).load(function() {
	$('IMG').addClass('loaded');
	
	$('SECTION.highlights-section').fadeIn();
	
	if($(window).width() > 920) {
		$('.article-link-box .menu-image').each(function() {
			$(this).attr('src', $(this).data('src'));
		});
	}
});